package com.loop;

public class OddNumberswhile
{
	
	public static void oddnum( )
    {
  	  int i=121;
  	  while(i<=229)
  	  {
  		  if(i%2!=0)
  		      System.out.println(i);
  		  i++;
  	  }
  	  
     }

	public static void main(String[] args) {
		// TODO Auto-generated method stub
         oddnum();
	}

}
